package main

import (
	"context"
	"fmt"
	"net/http"
	"strings"
	"sync"
	"time"

	"go.uber.org/atomic"
	"golang.org/x/sync/semaphore"
)

func main() {
	start := time.Now()
	succeeded := atomic.NewInt64(0)
	failed := atomic.NewInt64(0)
	sem := semaphore.NewWeighted(40) // number of concurrent requests

	wg := sync.WaitGroup{}
	for _, qry := range queries {
		qry := qry
		name := strings.Replace(qry["url"], "http://localhost:9009/v1/instances/default/queries", "", 1)

		wg.Add(1)
		go func() {
			sem.Acquire(context.Background(), 1)
			defer sem.Release(1)
			defer wg.Done()

			req, err := http.NewRequest(qry["method"], qry["url"], strings.NewReader(qry["body"]))
			if err != nil {
				panic(err)
			}

			resp, err := http.DefaultClient.Do(req)
			if err != nil {
				fmt.Printf("%s failed with err: %v\n", name, err)
				failed.Add(1)
				return
			}
			defer resp.Body.Close()

			if resp.StatusCode < 400 {
				succeeded.Add(1)
				fmt.Printf("%s succeeded with status: %v\n", name, resp.Status)
			} else {
				failed.Add(1)
				fmt.Printf("%s failed with status: %v\n", name, resp.Status)
			}
		}()
	}
	wg.Wait()

	fmt.Printf("Succeeded=%d, failed=%d\n", succeeded.Load(), failed.Load())
	fmt.Printf("Elapsed: %v\n", time.Since(start))
}

